<html>

<head>
    <style>
        h4 {
            color: #253858;
            margin-bottom: .8rem;
            position: relative;
            font-family: 'Raleway', sans-serif;
            font-size: 1.5rem;
        }

        p {
            margin-top: 0;
            margin-bottom: 1rem;
            display: block;
            margin-block-start: 1em;
            margin-block-end: 1em;
            margin-inline-start: 0px;
            margin-inline-end: 0px;
            color: rgb(113, 120, 126);
            font-family: 'Lato', sans-serif;
        }

        .btn-primary:hover {
            color: #fff;
            background-color: #0069d9;
            border-color: #0062cc;
        }

        .btn-primary {
            color: #fff;
            background-color: #0069d9;
            border-color: #0062cc;
        }

        .btn-round {
            border-radius: 30px !important;
            text-decoration: none;
        }

        .btn {
            font-size: 15px;
            font-weight: 600;
            padding: 9px 25px;
            border-width: 2px;
            box-shadow: 0 3px 8px 0 rgba(41, 49, 89, .15), inset 0 0 0 1px hsla(0, 0%, 100%, .1);
        }

        .btn {
            display: inline-block;
            font-weight: 400;
            text-align: center;
            white-space: nowrap;
            vertical-align: middle;
            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;
            border: 1px solid transparent;
            padding: .375rem .75rem;
            font-size: 1rem;
            line-height: 1.5;
            border-radius: .25rem;
            transition: color .15s ease-in-out, background-color .15s ease-in-out, border-color .15s ease-in-out, box-shadow .15s ease-in-out;
        }

        .btn:not(:disabled):not(.disabled) {
            cursor: pointer;
        }

        .error-content {
            padding: 0 0 200px;
        }

        .error-text {
            text-align: center;
        }

        .error {
            font-size: 40px;
            font-weight: 0;
        }

        @keyframes bob {
            0% {
                top: 0;
            }

            50% {
                top: 0.2em;
            }
        }

        body,
        html {
            height: 100%;
        }

        .error-content {
            min-height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        img {
            max-width: 100%;
            height: auto;
        }

        .space-between {
            margin-top: 20px;
        }

        footer {
            background-color: #f1f1f1;
            padding: 20px;
            text-align: center;
        }

        .cloudflare-details {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
        }

        .cloudflare-item {
            flex: 1;
            min-width: 200px;
            padding: 10px;
        }
    </style>
